import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open mobile menu
    await page.click('.nav-menu'); // Click on the mobile menu button
    await page.waitForSelector('.mobile-menu'); // Wait for the mobile menu to appear
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_opened.png'));

    // Navigate to a category
    await page.click('text=Electronics'); // Click on the Electronics category
    await page.waitForLoadState('networkidle'); // Wait for the page to load
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_to_electronics.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_to_electronics.png'));

    // Close the mobile menu
    await page.click('.close-mobile-menu'); // Click on the close button
    await page.waitForSelector('.mobile-menu', { state: 'hidden' }); // Wait for the menu to close
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    // Verify navigation
    const pageTitle = await page.title();
    const isElectronicsPage = pageTitle.includes('Electronics'); // Check if the page title includes 'Electronics'

    return {
      success: true,
      action: "Successfully navigated through the mobile menu to the Electronics category and closed the menu.",
      extractedData: { isElectronicsPage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
